			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "APP_PATH=\"${TARGET_BUILD_DIR}/${WRAPPER_NAME}\"\n\n# This script loops through the frameworks embedded in the application and\n# removes unused architectures.\nfind \"$APP_PATH\" -name '*.framework' -type d | while read -r FRAMEWORK\ndo\n  FRAMEWORK_EXECUTABLE_NAME=$(defaults read \"$FRAMEWORK/Info.plist\" CFBundleExecutable)\n  FRAMEWORK_EXECUTABLE_PATH=\"$FRAMEWORK/$FRAMEWORK_EXECUTABLE_NAME\"\n  echo \"Processing framework: $FRAMEWORK_EXECUTABLE_NAME\"\n\n  #  Skip Hermes.framework (it's already a thin binary, lipo will fail on it)\n  if [[ \"$FRAMEWORK_EXECUTABLE_NAME\" == \"hermes\" ]]; then\n    echo \"Skipping Hermes framework\"\n    continue\n  fi\n\n  #  Check if the file is a valid Mach-O fat file\n  FILE_TYPE=$(file \"$FRAMEWORK_EXECUTABLE_PATH\")\n  if [[ \"$FILE_TYPE\" != *\"fat\"* && \"$FILE_TYPE\" != *\"universal binary\"* ]]; then\n    echo \"Skipping $FRAMEWORK_EXECUTABLE_NAME (not a fat/universal binary)\"\n    continue\n  fi\n\n  EXTRACTED_ARCHS=()\n\n  for ARCH in $ARCHS\n  do\n    echo \"  Extracting $ARCH from $FRAMEWORK_EXECUTABLE_NAME\"\n    lipo -extract \"$ARCH\" \"$FRAMEWORK_EXECUTABLE_PATH\" -o \"$FRAMEWORK_EXECUTABLE_PATH-$ARCH\"\n    EXTRACTED_ARCHS+=(\"$FRAMEWORK_EXECUTABLE_PATH-$ARCH\")\n  done\n\n  echo \"  Merging extracted architectures: ${ARCHS}\"\n  lipo -o \"$FRAMEWORK_EXECUTABLE_PATH-merged\" -create \"${EXTRACTED_ARCHS[@]}\"\n  rm \"${EXTRACTED_ARCHS[@]}\"\n\n  echo \"  Replacing original executable with thinned version\"\n  rm \"$FRAMEWORK_EXECUTABLE_PATH\"\n  mv \"$FRAMEWORK_EXECUTABLE_PATH-merged\" \"$FRAMEWORK_EXECUTABLE_PATH\"\ndone\n";
		};
